        private int FindMisingNumber(int[] inputArray, int lengthArry)
        {
            var item = inputArray.ToList();
            item.Sort();
            int counter = 0;
            var tempArr = item.ToArray();
            for (int i = 0; i < tempArr.Length -1; i++)
            {
                if (tempArr[i] != tempArr[i+1] -1)
                {
                    counter = tempArr[i] + 1;
                    break;
                }
            }
            return counter;
        }

