        private int[] duplicates(int[] arr, int n)
        {
            //Your code here
            int[] dupArry = new int[arr.Length / 2 + 1];
            int index = 0;
            for (int i = 0; i < arr.Length - 1; i ++)
            {
                if (arr[i] == arr[i+1])
                {
                    dupArry[index] = arr[i];
                    index++;
                }
            }
            return dupArry;
        }

