        private int[] LeadersInArray(int[] input, int numCnt)
        {
            List<int> lstData = new List<int>();
            List<int> lstInput = input.ToList();

            while (lstInput.Count > 0)
            {
                var maxCur = lstInput.Max();
                var index = lstInput.FindIndex(x => x == maxCur);                
                if (index == 0 && lstData.Where(x=>x==maxCur).Count() ==0)
                {
                    lstData.Add(lstInput[0]);
                    lstInput.RemoveAt(0);
                } else if (index != 0 && lstInput.Count != 1)
                {
                    lstData.Add(maxCur);
                    lstInput.RemoveRange(0, index);
                } else
                {
                    lstInput.RemoveAt(0);
                }
                
            }          
            return lstData.ToArray();

        }


        private int[] ListSubArrayMaxBruteForce(int[] inputArry , int lengthArry)
        {
            List<int> lstResult = new List<int>();
            int maxResult = 0;
            int runningMax = 0;

            for (int i =0; i < lengthArry-1; i++)
            {
                runningMax = inputArry[i] + inputArry[i + 1];
                if (runningMax> maxResult)
                {
                    maxResult = runningMax;
                    lstResult.Clear();
                    lstResult.Add(i);
                    lstResult.Add(i + 1);
                }  
                 
            }
            return lstResult.ToArray();
        }

        private string[] SlidingWindowMatchANumber(int[] inputArray, int sumValue)
        {
            int counter = 0;
            int runnSum = 0;
            int runIndex = 0;
            string runnArr = string.Empty;
            List<string> lstResult = new List<string>();
            while (counter < inputArray.Length)
            {
                runnSum = runnSum + inputArray[counter];
                runnArr = runnArr + inputArray[counter].ToString() + ","; 
                if (runnSum == sumValue)
                {
                    lstResult.Add(runnArr);

                } else if (runnSum > sumValue)
                {
                    runnSum = runnSum - inputArray[runIndex];
                    runIndex++;
                    runnArr = runnArr.Substring(2);
                }
                counter++;
            }

            return lstResult.ToArray();
        }
        

        private int ReturnEquibilliumPoint(int[] inputArray, int leng)
        {
            int result = 0;
            int totalSum = 0 , sumBack = 0;
            for (int i =0; i < leng; i++)
            {
                totalSum = totalSum + inputArray[i]; 

            }

            for (int i =0; i < leng; i++)
            {
                sumBack = sumBack + inputArray[leng - i -1];
                totalSum = totalSum - inputArray[i];
                if (totalSum == (sumBack + inputArray[i + 1]))
                {
                    result = inputArray[i + 1];
                    break;
                }
            }
            return result;
        }


