        private int ReturnSearchBinary(int[] nums, int target)
        {
            int result = -1;
            bool found = false;
            int length = nums.Length;
            var midPoint =(int) Math.Round((double)length / 2);          
            int left = 0, right = nums.Length -1;

            while(!found)
            {
                midPoint = (int)Math.Round((double)( left + right) / 2);
                if (midPoint > nums.Length - 1) break;
                if (left > right)
                {
                    break;
                }
               
                if (nums[midPoint] == target)
                {
                    result = midPoint;
                    break;
                } else if (nums[midPoint] > target)
                {
                    right = midPoint - 1;

                } else if (nums[midPoint] < target)
                {
                    left = midPoint +1;
                }
                
            }
            return result;
        }

        public int GetSmallestInt(int[] nums)
        { 
            int nextVal = 1;
            Array.Sort(nums);
            
            for (int i = 0; i < nums.Length; i++) 
            {
                if (nums[0] != 1)
                {
                    nextVal = 1;
                    break;
                } 
                if (nums[i] > 0)
                {
                    nextVal = nums[i] + 1;
                    if (i == nums.Length - 1) break;
                    if(nums[i+1] > nextVal)
                    {
                        break;
                    }
                }
            }
            return nextVal;
        }
