        public int SearchInsert(int[] nums, int target)
        {
            int result = -1;
            int left = 1;
            int right = nums.Length;
            int mid = 0;


            while (left < right)
            {
                mid = (left + right) / 2;
                if (nums[mid] == target)
                {
                    result = mid;
                    break;
                }
                else if (nums[mid] > target)
                {
                    right = mid - 1;
                }
                else if (nums[mid] < target)
                {
                    left = mid + 1;
                }
            }

            if (result == -1)
            {
                if (left == 1 && nums[0] == target)
                    result = 0;
                else if (left == 1 && nums[0] < target)
                    result = 1;
                else
                    result = left;
            }
            return result;
        }


        public int solution(int X, int[] B, int Z)
        {
            // write your code in C# 6.0 with .NET 4.5 (Mono)
            int result = 0;

            if (B.Length ==0 )
            {
                result = -1;
            } else
            {
                int totalRemainDownload = X - B.Sum();
                if(totalRemainDownload == 0)
                {
                    result = 0;
                } else if (Z > B.Length)
                {
                    result = -1;
                } else
                {
                    int counter = 0;
                    int tempSum = 0;
                    int tempRun = Z;
                    while(tempRun >= counter)
                    {
                        counter++;
                        tempSum += B[B.Length - counter];
                     
                        tempRun--;
                    }

                    int tempAvg = Math.Abs(tempSum / Z);
                    result = Math.Abs(totalRemainDownload / tempAvg);
                }

            }
             
            return result;
        }

        public string solution(int X)
        {
            string result = string.Empty;
            int remainingTime;
            int cutOff;
            int count = 0;


            if (X == 0)
            {
                result = string.Empty;
                return result;
            }
            else if (X < 60)
            {
                result = X.ToString() + "s";
                return result;
            }

            cutOff = Math.Abs(X / 604800);
            if (cutOff >= 1)
            {
                result = result + cutOff.ToString() + "w";
                remainingTime = X - (604800*cutOff);
                X = remainingTime;
                count++;
            }

            cutOff = Math.Abs(X / 86400);
            if (cutOff >= 1)
            {
                count++;
                if (count == 2)
                {
                    result = result + (cutOff + 1).ToString() + "d";
                    return result;
                } else
                {
                    result = result + (cutOff).ToString() + "d";
                    remainingTime = X - (86400*cutOff);
                    X = remainingTime;
                }
            }

            cutOff = Math.Abs(X / 3600);
            if (cutOff >= 1)
            {
                count++;
                if (count == 2)
                {
                    result = result + (cutOff + 1).ToString() + "h";
                    return result;
                }
                else
                {
                    result = result + (cutOff).ToString() + "h";
                    remainingTime = X - (3600*cutOff);
                    X = remainingTime;
                }
            }

            cutOff = Math.Abs(X / 60);
            if (cutOff >= 1)
            {
                count++;
                if (count == 2)
                {
                    result = result + (cutOff + 1).ToString() + "m";
                    return result;
                }
                else
                {
                    result = result + (cutOff).ToString() + "m";
                    remainingTime = X - (60*cutOff);
                    X = remainingTime;
                }
            }

            result = result + (X).ToString() + "s";
            return result;
        }


